RT @CNBCTheExchange: A proposal to extend the extra $600/week unemployment benefit just stalled in the senate, as it's set to expire tomorrow.

Sen. @amyklobuchar to @KellyCNBC on the ongoing stimulus talks and looming deadline: "I don't think we can go home without getting this done"

